import styled from 'styled-components'
import cat404 from './img/404.webp'

const NotFound = () => {
  return (
    <Container>
      <img src={cat404} alt='not found' />
      <span> Even my cat bugged </span>
    </Container>
  )
}

const Container = styled.div`
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 2em;
`

export default NotFound
